//SPDX-License-Itendifier: MIT

pragma solidity ^0.8.7;

error NotOwner();
error invalidRequired();
error AlreadyOwner();

contract MultiSigWallet {

    event Deposit(address sender, uint256 value, uint256 balance);

    address[] public owners;
    mapping (address => bool) public isOwner;

    struct Transaction {
        uint256 id;
        address to;
        uint256 value;
        bytes data;
        uint256 confirmations;
        bool executed;
    }

    mapping(uint256 => Transaction) public transactions;
    mapping(uint256 => mapping(address => bool)) public approved;
    uint256 public required;
    uint256 public txId;

    modifier onlyOwner() {
        if (!isOwner[msg.sender]) {
            revert NotOwner();
        }
        _;
    }

    constructor (uint256 _required, address[] memory _owners) {
        if (_required > owners.length) {
            revert invalidRequired();
        }
        for(uint256 i = 0; i < _owners.length; i++) {
            address owner = _owners[i];

            if(isOwner[owner]) {
                revert AlreadyOwner();
            }
            isOwner[owner];
            owners.push(owner);
        }
    }

    receive() external payable {
        emit Deposit(msg.sender, msg.value, address(this).balance);
    }

    function submitTx(address _to, uint256 _value, bytes memory _data) external onlyOwner {
        Transaction storage transaction = transactions[txId];
        transaction.id = txId;
        transaction.to = _to;
        transaction.value = _value;
        transaction.data = _data;
    }

    function approveTx() external onlyOwner {}

    function executeTx() external onlyOwner {}

    function revokeTx() external onlyOwner {}

}

